import React from 'react';
import { Card, Grid, CardContent, CardMedia, Typography, Button } from '@mui/material';
import styled from 'styled-components'

const Container = styled.div`
display: flex;
flex-direction: column;
justify-content: center;
position: relative;
z-index: 1;
align-items: center;
`


const Wrapper = styled.div`
position: relative;
display: flex;
justify-content: space-between;
align-items: center;
flex-direction: column;
width: 100%;
max-width: 700px;
gap: 12px;
@media (max-width: 960px) {
    flex-direction: column;
}
`

const Other = () => {
  return (
    <Container>
        <Wrapper>
    <Grid container spacing={10} align= "center">

      {/* First Card */}
      <Grid item>
        <Card style={{ maxWidth: '18rem' }}>
          <CardMedia
            component="img"
            alt="Placeholder image"
            height="180"
            image="https://via.placeholder.com/180"
          />
          <CardContent>
            <Typography variant="h5" component="div">
              Card Title 1
            </Typography>
            <Typography variant="body2" color="text.secondary">
              Some quick example text for the first card.
            </Typography>
            <Button variant="contained" color="primary">
              Go somewhere
            </Button>
          </CardContent>
        </Card>
      </Grid>

      {/* Second Card */}
      <Grid item>
        <Card style={{ maxWidth: '18rem' }}>
          <CardMedia
            component="img"
            alt="Placeholder image"
            height="180"
            image="https://via.placeholder.com/180"
          />
          <CardContent>
            <Typography variant="h5" component="div">
              Card Title 2
            </Typography>
            <Typography variant="body2" color="text.secondary">
              Some quick example text for the second card.
            </Typography>
            <Button variant="contained" color="primary">
              Go somewhere
            </Button>
          </CardContent>
        </Card>
      </Grid>
    </Grid>
    </Wrapper>
    </Container>
  );
};

export default Other;
